import "./App.css";
import Experiences from "./components/Experiences.jsx";
import Intro from "./components/Intro.jsx";
import Skills from "./components/Skills";
import Projects from "./components/Projects";
import AnimatedCursor from "react-animated-cursor";

function App() {
  return (
    <div>
      <AnimatedCursor
        innerSize={8} // Size of the inner cursor dot
        outerSize={8} // Size of the outer cursor dot
        color="193, 11, 111" // Color of the cursor in RGB
        outerAlpha={0.2} // Transparency of the outer cursor dot
        innerScale={0.7} // Scale of the inner dot on hover/click
        outerScale={5} // Scale of the outer dot on hover/click
        clickables={[
          "a",
          {
            target: ".custom", // Custom class for additional styles
            options: {
              innerSize: 12, // Larger inner cursor dot for .custom class
              outerSize: 12, // Larger outer cursor dot for .custom class
              color: "255, 255, 255", // White color for .custom class
              outerAlpha: 0.3, // Higher transparency for .custom class
              innerScale: 0.7, // Scale of inner dot on hover/click for .custom class
              outerScale: 5, // Scale of outer dot on hover/click for .custom class
            },
          },
        ]}
      />
      <main className="w-full bg-slate-900 text-white font-serif">
        <Intro />
        <Skills />
        <Experiences />
        <Projects />
      </main>
    </div>
  );
}

export default App;
